import React from 'react';
//import { Header } from '../home-element/Header';
//import { Footer } from '../home-element/Footer';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';

/*
* Purpose: Estilo predefinido/predeterminado. 
*/
const useStyles = makeStyles((theme) => ({
    root: {
      '& .MuiTextField-root': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
  }));

/**
  *  @author : juan felipe osorio zapata <juan.felipe.osorio@correounivalle.edu.co>
  *  @decs  : Componente de categorias de las personas dentro de la App. 
*/

export function Categorias(props) {
    const classes = useStyles();

    return (
            <div>
            <form className={classes.root} noValidate autoComplete="off">
            <TextField id="standard-basic" label="entrada Basica" />
            <TextField id="filled-basic" label="Filled" variant="Relleno" />
            <TextField id="outlined-basic" label="Outlined" variant="Por fuera" />
            </form>
            </div>
    )
}
